import React from "react";
import ListItem from "./ListItem";
import NewStudent from './NewStudent';

function Students({id, name, handleRemove, handleAddNew}){
  console.log("(S)name: ", name)
  console.log("(S)id: ", id)

  //Work on getting that "id" from the destructed props, into
  //ListItem
  const displayStudents = name.map((names, id) => {
    console.log("(S)Name: ", name)
    return <ListItem 
      key={id}
      id={id}
      student_name={names}
      onRemove={handleRemove}
      onAddNewStudent={handleAddNew}
    />
    }
  )

  return(
    <div>
      <header>
        Currently Enrolled Students
      </header>
      <NewStudent />
      {displayStudents}
    </div>
  )
}

export default Students;
